import React from 'react';
import { Grommet, Box, Text } from 'grommet';
import { Entete } from './features/Header/Header';
import Welcome from './features/Body/Welcome';

const theme = {
  global: {
    font: {
      family: 'Roboto',
      size: '18px',
      height: '20px',
    },
  },
};

function App() {
  return( 
  <Grommet  theme={theme} full>
    <Entete />
    <Welcome />
  </Grommet>
  )
}

export default App;
